import Axios from "axios";

export default function getUser(cb) {
    const user = {}
    Axios.get("http://localhost:3000/api/reqUser", { withCredentials: true })
        .then(response => {
        console.log(response.data);
        response.data = user
        localStorage.setItem("tokens", response.data.auth)
        .then(cb(user))
    })
}
